import React, { Component } from 'react';
import { Grid } from 'semantic-ui-react'
import 'semantic-ui-css/semantic.min.css';
// import logo from './logo.svg';
import './App.css';
import  StockTable from './StockTable';
import  SearchBar from './SearchBar';

import Chart from './Chart';

/*
  <Grid columns={3}>
    <Grid.Row>
      <Grid.Column>
        <Image src='https://react.semantic-ui.com/images/wireframe/paragraph.png' />
      </Grid.Column>
      <Grid.Column>
        <Image src='https://react.semantic-ui.com/images/wireframe/paragraph.png' />
      </Grid.Column>
    </Grid.Row>

    <Grid.Row>
      <Grid.Column>
        <Image src='https://react.semantic-ui.com/images/wireframe/paragraph.png' />
      </Grid.Column>
      <Grid.Column>
        <Image src='https://react.semantic-ui.com/images/wireframe/paragraph.png' />
      </Grid.Column>
      <Grid.Column>
        <Image src='https://react.semantic-ui.com/images/wireframe/paragraph.png' />
      </Grid.Column>
    </Grid.Row>
  </Grid>
*/
class App extends Component {
  render() {
    return (
      <div className="App">
        <SearchBar /> 
          <Grid columns={2}>
          <Grid.Row>
            <Grid.Column>
              <Chart />
            </Grid.Column>
            <Grid.Column>
             <StockTable /> 
            </Grid.Column>
        
          </Grid.Row>
        </Grid>  
      </div>


    );
  }
}

export default App;
